import React from "react";

import { Routes, Route } from "react-router-dom";

import Landingpage from "./Landingpage";
import Transport from "./Transport";
import Inventory from "./Inventory";
import Production from "./Production";
import Reports from "./Reports";
import Home from "./Home";

const Navbar = () => {
  return (
    <div className="flex h-screen">
      {/* Sidebar */}
      <aside className="w-64 bg-gray-800 text-white p-6 flex flex-col justify-between">
        <div>
          <h1 className="text-2xl font-bold text-[#359BD2] ">AVILAMBH</h1>
          <nav className="mt-6 space-y-4">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/landingpage" element={<Landingpage />} />
              <Route path="/inventory" element={<Inventory />} />
              <Route path="/reports" element={<Reports />} />
              <Route path="/production" element={<Production />} />
              <Route path="/transport" element={<Transport />} />
            </Routes>
            {/* <a className="block text-gray-300 hover:text-white">HOME</a>
            <a className="block text-gray-300 hover:text-white">REPORTS</a>
            <a className="block text-gray-300 hover:text-white">SAFETY</a>
            <a className="block text-gray-300 hover:text-white">TRANSPORT</a>
            <a className="block text-lg font-bold text-white ">INVENTORY</a> */}
          </nav>
        </div>
      </aside>
    </div>
  );
};

export default Navbar;
